import { useRef } from "react";
import { FaBars, FaTimes } from "react-icons/fa";
import "../CSS/Navbar.css";

function Navbar() {
    const navRef = useRef();

    const showNavbar = () => {
        navRef.current.classList.toggle(
            "responsive_nav"
